import React, { useState } from 'react';
import Photo from './Photo';


import bImage from './img/b.jpeg';
import mnImage from './img/mn.jpeg';
import mImage from './img/m.jpeg';
import uImage from './img/u.jpeg';
import hImage from './img/h.jpeg';
import cImage from './img/c.jpeg';

export default function Cards() {
  const [cards, setCards] = useState([
    { id: 0, name: 'b', status: '', img: bImage },
    { id: 1, name: 'mn', status: '', img: mnImage },
    { id: 2, name: 'm', status: '', img: mImage },
    { id: 3, name: 'u', status: '', img: uImage },
    { id: 4, name: 'h', status: '', img: hImage },
    { id: 5, name: 'c', status: '', img: cImage },
    { id: 6, name: 'b', status: '', img: bImage },
    { id: 7, name: 'mn', status: '', img: mnImage },
    { id: 8, name: 'm', status: '', img: mImage },
    { id: 9, name: 'u', status: '', img: uImage },
    { id: 10, name: 'h', status: '', img: hImage },
    { id: 11, name: 'c', status: '', img: cImage },
  ].sort(() => Math.random() - 0.5));

  return (
    <div className="main" style={{ display: 'flex', flexWrap: 'wrap' }}>
      {cards.map((card, index) => {
        return <Photo key={index} card={card} />;
      })}
    </div>
  );
}
